import React, { Component } from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUserCircle } from '@fortawesome/free-solid-svg-icons'
import './User.css'

export default class User extends Component {
    render() {
        const center ={
            textAlign: "center"
        }
        return (
            <div className="mainBg">
                <div className="formContainer">
                    <form>
                        <h3 style={center}>Sign In</h3>
                        {/* <label className="formLabel">User Id</label><br></br> */}
                        <FontAwesomeIcon icon={faUserCircle} color="white" size="2x"/>
                        <input className="inputField" type="text" placeholder="Username" autoComplete="off"></input>
                        <br />
                        {/* <label className="formLabel">Password</label><br></br> */}
                        <input className="inputField" type="password" placeholder="Password"></input>
                        <br/>
                        <input className="inputField btn" type="submit" value="Login"></input>
                    </form>
                </div>
            </div>
        )
    }
}
